import React from "react";
import ToDoContext from "../context/ToDoContext";

function Lista() {
  return (
    <ToDoContext.Consumer>
      {({ todos }) => (
        <ul>
          {todos.map((todo, index))}
        </ul>
      )}
    </ToDoContext.Consumer>
  );
}

export default Lista;
